pragma solidity ^0.8.7;

contract Ownable {
    address owner;
    
    constructor() {
        owner = msg.sender;
    }
}

contract TestStore is Ownable {
    function sendMoney() public payable {
        (bool success, ) = owner.call{value: msg.value}('');
    }
    
    function showOwner() public view returns(address) {
        return owner;
    }
}
